import React from 'react';

// Dummy component
const MyForm = props => {
	return (
		<form style={styles.myForm}>
			<div style={styles.inputContainer}>
				<input placeholder="Post Title" style={styles.input} />
			</div>
			<div style={styles.inputContainer}>
				<input placeholder="Post Description" style={styles.input} />
			</div>
			<div style={styles.buttonContainer}>
				<button style={styles.button}>Create Post</button>
			</div>
		</form>
	);
};

// Export
export default MyForm;

// Styling with CSS-in-JS
const styles = {
	myForm: {
		width: '30%',
		margin: '0 auto',
		alignItems: 'center',
		backgroundColor: 'grey',
		color: 'black',
		borderRadius: '10px',
	},
	inputContainer: {
		padding: '10px',
		display: 'flex',
	},
	input: {
		padding: '10px',
		margin: '5px',
		flex: '1',
	},
	buttonContainer: {
		textAlign: 'right',
	},
	button: {
		backgroundColor: 'blue',
		color: 'white',
		padding: '10px',
		cursor: 'pointer',
	},
};
